     *      RList(InitR),ErrMin
      WRITE(IW,'(" R =",F10.3,2X,"Maximum error = ",E18.9E2)')R,Error
      WRITE(IW,'(" R =",F10.3,2X,"Maximum error = ",E18.9E2/)')
     *      RList(InitR+1),ErrMax
      IF ((Error.GT.ErrMin).AND.(Error.LT.ErrMax)) THEN
         WRITE(IW,'(" Convergence is GOOD.")')
         Change = .FALSE.
         RETURN
      ELSE
         WRITE(IW,'(" Convergence is not good.")')
         InitR = InitR+1
         Change = .TRUE.
      ENDIF
  999 CONTINUE
      RETURN
      END
